          <p class="message-text">
            当社は1981年の創業以来、空調・給排水設備工事を通じて、人々の暮らしや地域社会の快適さを支えてまいりました。<br>
            特に市原市を中心とした地域密着型の姿勢を大切にし、近年ではすべての市内小中学校へのエアコン設置工事など、公共事業にも積極的に取り組んでいます。<br>
            <br>
            <span>「見えないところにこそ、本当の価値がある」</span>
